var express = require("express")
var app = express()
var bodyParser = require("body-parser")

app.use(bodyParser.urlencoded({extended: true}))
app.set("view engine", "ejs")

var campgrounds = [
    { name: "Sasha Camp", image: "data:image/jpeg;base64," },
    { name: "Tsavo West", image: "data:image/jpeg;base64," },
    { name: "Sagalla Hills", image: "data:image/jpeg;base64," },
    { name: "Rapids Camp, Sagana", image: "http://www.travelstart.co.ke/blog/wp-content/uploads/2014/08/Rapid-Camp-Sagana.gif"},
    { name: "Malewa Bush Ventures", image: "http://www.travelstart.co.ke/blog/wp-content/uploads/2014/08/Mayewa-Bush-Ventures.jpg" },
    { name: "Camp Carnelley’s", image: "http://www.travelstart.co.ke/blog/wp-content/uploads/2014/08/Campcarnelleys-780x585.jpg" },
    { name: "El Karama", image: "http://www.travelstart.co.ke/blog/wp-content/uploads/2014/08/El-Karama.jpg" },
    { name: "Kiboko Camp", image: "http://www.travelstart.co.ke/blog/wp-content/uploads/2014/08/Kiboko.jpg" },
    { name: "Mamba Village", image: "http://www.travelstart.co.ke/blog/wp-content/uploads/2014/08/Mamba-Village-780x520.jpg" }
]

app.get("/", function(req, res){
    res.render("landing")
})

app.get("/campgrounds", function(req, res){
    res.render("campgrounds", {campgrounds: campgrounds})
})

app.post("/campgrounds", function(req, res){
    //get data from form and add to campgrounds array
    var name = req.body.name
    var image = req.body.image
    var newCampground = {name: name, image: image}
    campgrounds.push(newCampground)
    //redirect back to campgrounds page
    res.redirect("/campgrounds")
})

app.get("/campgrounds/new", function(req, res){
    res.render("new.ejs")
})

app.listen(3004, function(req, res){
    console.log("YelpCamp server serving on port 3004")
})